Window.Script:
function form_OnLoadCompleted(obj)
{ 
	Ubi.resource = "fixed";
	Ubi.setFileURL(G_SERVER_URL+"report/IMG");
	Ubi.setJrfFileDir(G_SERVER_URL+"report/PS/");


	Ubi.FontRevision = true;
	Ubi.setPageScale(130);
	Ubi.setJrfFileName("PS0410005P.jrf");
	//TRACE(ds_master2.SaveXML());	
	Ubi.SetDataset("ds_print", "ds_print");
	Ubi.SetDataset("ds_print_d", "ds_print_d");
	Ubi.Retrieve();
}
